import initialState from './initialState';
import { CREATE_PROJECT } from '../types/projectTypes';

const projectReducers = (state = initialState.projects, action) => {
    switch (action.type) {
        case CREATE_PROJECT:
          console.log()
    }
    return state;

}
export default projectReducers;
